import './ItemStyle.scss';

function Item(props: {itemstack: any;}){

    return (
        <div className="item">
            <i className={"icon-minecraft icon-minecraft-" + props.itemstack.Type}></i>
            <span className='item-amount'>{props.itemstack.amount}</span>
        </div>
    );
}
export default Item;
